/* Default */
import React from 'react'

/* Packages */
import { NormalizeCss, Box, Flex, Track } from 'react-bee'

const App = () => {
  return (
    <>
      <NormalizeCss />
      <Box fullWidth>
        <Flex justifyContent='' gridGap='0px' flexWrap='wrap'>
          <>
            {Array(100)
              .fill()
              .map((empty, i) => (
                <Track
                  key={i}
                  background={`#${Math.floor(Math.random() * 16777215).toString(
                    16
                  )}`}
                  flex="1 1 auto"
                >
                  {i}
                </Track>
              ))}
          </>
        </Flex>
      </Box>
    </>
  )
}

export default App

const TestTrack = ({ index, background }) => (
  <div style={{ background: background, padding: '10px', flex: '1 1 auto' }}>
    {index}
  </div>
)
